import React from "react";
import Entry from "./Entry";
import emojipedia from "../emojipedia";

function createEntry(prop) {
  return (
    <Entry
      key={prop.id}
      emoji={prop.emoji}
      name={prop.name}
      meaning={prop.meaning}
    />
  );
}

function App() {
  return (
    <div>
      <h1>
        <span>emojipedia</span>
      </h1>

      <dl className="dictionary">{emojipedia.map(createEntry)}</dl>
    </div>
  );
}

export default App;
